/**
 * Escapes HTML special characters to prevent XSS attacks
 * @param {string} text - Input text to escape
 * @returns {string} Escaped string safe for HTML insertion
 */
export function escapeHtml(text) {
  if (text === null || text === undefined) {
    return '';
  }

  const str = String(text);
  const htmlEscapes = {
    '&': '&amp;',
    '<': '&lt;',
    '>': '&gt;',
    '"': '&quot;',
    "'": '&#39;',
    '/': '&#x2F;',
    '`': '&#x60;',
    '=': '&#x3D;'
  };

  return str.replace(/[&<>"'`=\/]/g, function(s) {
    return htmlEscapes[s];
  });
}

/**
 * Sanitizes user input to remove potentially dangerous content
 * @param {string} input - Raw user input
 * @returns {string} Sanitized string
 */
export function sanitizeInput(input) {
  if (!input) return '';

  // Remove script tags and event handlers
  let sanitized = String(input)
    .replace(/<script\b[^<]*(?:(?!<\/script>)<[^<]*)*<\/script>/gi, '')
    .replace(/on\w+\s*=\s*["'][^"']*["']/gi, '')
    .replace(/javascript:/gi, '');

  return sanitized.trim();
}

/**
 * Validates that input is a safe string without HTML
 * @param {*} input - Any input value
 * @returns {boolean} True if input is safe
 */
export function isSafeString(input) {
  if (typeof input !== 'string') return false;

  // Check for common XSS patterns
  const dangerousPatterns = [
    /<script/i,
    /javascript:/i,
    /on\w+\s*=/i,
    /<iframe/i,
    /<object/i,
    /<embed/i
  ];

  return !dangerousPatterns.some(pattern => pattern.test(input));
}

export function cn(...classes) {
  return classes.filter(Boolean).join(' ');
}
